import React, { useEffect } from 'react';
import './App.css';

const { kakao } = window;

useEffect(() => {
  const container = document.getElementById('myMap');
    const options = {
      center: new kakao.maps.LatLng(33.450701, 126.570667),
      level: 3
    };
  const map = new kakao.maps.Map(container, options);
}, []);

function Map() {
    return (
        <div id='myMap'></div>
    );
}

export default Map;
